import React from 'react';
import { HomeBody, ActionContainer, HeaderContainer } from './styles';


const Home = () => {
  return (
    <HomeBody>
     <ActionContainer>
         <div>Sign Up</div>
        <div>Login</div>
     </ActionContainer>
     <HeaderContainer>
        <div>
            <div className="title">Aaya</div>
            <div className="moto">moto</div>
        </div>
         <div>
             <div className="Logo-wrapper">
                 <img src="" className="logo" alt="logo"/>
             </div>
         </div>
     </HeaderContainer>
    </HomeBody>
  );
}

export default Home;
